// src/HomePage.js
import { useNavigate } from 'react-router-dom';
import { useState, useEffect } from 'react';

export default function HomePage() {
  const navigate = useNavigate();
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Simular carregamento da página
    const timer = setTimeout(() => {
      setIsLoading(false);
    }, 1000);
    return () => clearTimeout(timer);
  }, []);

  return (
    <main className="min-h-screen bg-gradient-to-b from-[#0c1424] to-[#162036] text-white flex flex-col">
      {/* Hero Section */}
      <div className="flex-grow flex flex-col items-center justify-center px-6 pt-10 pb-16">
        {isLoading ? (
          <div className="flex items-center justify-center">
            <div className="animate-spin rounded-full h-16 w-16 border-t-2 border-b-2 border-[#3ddad7]"></div>
          </div>
        ) : (
          <div className="flex flex-col items-center gap-8 max-w-lg mx-auto">
            {/* Logo com efeito de sombra */}
            <div className="relative">
              <div className="absolute -inset-1 bg-gradient-to-r from-[#3ddad7] to-[#3d9fd7] rounded-2xl blur opacity-30 group-hover:opacity-100 transition duration-1000 group-hover:duration-200"></div>
              <img
                src="/logo.png.jpg"
                alt="Safeswap Logo"
                className="relative h-28 w-28 rounded-2xl shadow-lg object-cover"
              />
            </div>
            
            {/* Nome da plataforma com efeito de texto */}
            <div className="text-center">
              <h1 className="text-6xl font-extrabold bg-clip-text text-transparent bg-gradient-to-r from-[#3ddad7] to-[#67e8f9]">
                Safeswap
              </h1>
              <p className="mt-4 text-lg text-[#94a3b8]">
                A maneira mais segura de comprar seus ingressos
              </p>
            </div>
            
            {/* Botão principal de compra */}
            <button
              onClick={() => alert("Funcionalidade de compra ainda será implementada")}
              className="mt-8 w-full max-w-xs bg-gradient-to-r from-green-500 to-emerald-600 hover:from-green-400 hover:to-emerald-500 text-white px-10 py-5 rounded-2xl text-2xl font-bold transition duration-300 transform hover:scale-105 shadow-xl flex items-center justify-center gap-2"
            >
              <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 11V7a4 4 0 00-8 0v4M5 9h14l1 12H4L5 9z" />
              </svg>
              Comprar ingressos
            </button>
            
            {/* Link secundário para revenda, menos destacado */}
            <div className="mt-2">
              <button
                onClick={() => navigate('/revenda')}
                className="text-[#94a3b8] hover:text-[#3ddad7] text-base transition mt-2 flex items-center gap-1"
              >
                <span>Intermediação de revendas</span>
                <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M14 5l7 7m0 0l-7 7m7-7H3" />
                </svg>
              </button>
            </div>
          </div>
        )}
      </div>

      {/* Footer com informações de contato */}
      <footer className="text-sm text-center text-[#94a3b8] border-t border-[#1e293b] py-6 px-4">
        <div className="max-w-lg mx-auto grid grid-cols-1 md:grid-cols-3 gap-4">
          {/* Email */}
          <div className="flex items-center justify-center gap-2">
            <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-[#3ddad7]" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 8l7.89 5.26a2 2 0 002.22 0L21 8M5 19h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z" />
            </svg>
            <a href="mailto:ajuda@safeswapbr.com" className="text-[#3ddad7] hover:underline">
              ajuda@safeswapbr.com
            </a>
          </div>
          
          {/* WhatsApp */}
          <div className="flex items-center justify-center gap-2">
            <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-[#3ddad7]" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 18h.01M8 21h8a2 2 0 002-2V5a2 2 0 00-2-2H8a2 2 0 00-2 2v14a2 2 0 002 2z" />
            </svg>
            <a href="https://wa.me/5511933478389" target="_blank" rel="noopener noreferrer" className="text-[#3ddad7] hover:underline">
              (11) 93347-8389
            </a>
          </div>
          
          {/* Instagram */}
          <div className="flex items-center justify-center gap-2">
            <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-[#3ddad7]" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 9a2 2 0 012-2h.93a2 2 0 001.664-.89l.812-1.22A2 2 0 0110.07 4h3.86a2 2 0 011.664.89l.812 1.22A2 2 0 0018.07 7H19a2 2 0 012 2v9a2 2 0 01-2 2H5a2 2 0 01-2-2V9z" />
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 13a3 3 0 11-6 0 3 3 0 016 0z" />
            </svg>
            <a href="https://instagram.com/safeswap_" target="_blank" rel="noopener noreferrer" className="text-[#3ddad7] hover:underline">
              @safeswap_
            </a>
          </div>
        </div>
        <p className="mt-4 text-xs text-[#64748b]">© {new Date().getFullYear()} Safeswap • Segurança garantida em todas as transações</p>
      </footer>
    </main>
  );
}
